import React, { useState, useEffect } from "react";
import axios from "axios";

const Dashboard = () => {
  const [lovSalesSeasons, setlovSalesSeasons] = useState([]);
  const [error, setError] = useState("");
  const [lovSalesSeasonSearchTerm, setlovSalesSeasonSearchTerm] = useState("");
  const [statusSearchTerm, setStatusSearchTerm] = useState("");

  // useEffect(() => {
  //   fetchlovSalesSeasons();
  // }, []);

  // const fetchlovSalesSeasons = async () => {
  //   try {
  //     const response = await axios.get("http://localhost:5001/api/lovSalesSeasons");
  //     setlovSalesSeasons(response.data);
  //   } catch (error) {
  //     console.error("Error fetching data:", error);
  //     setError("Failed to load data. Please try again later.");
  //   }
  // };
const numberFormatter = new Intl.NumberFormat("en-US", {
  minimumFractionDigits: 0,
  maximumFractionDigits: 0,
});

useEffect(() => {
  fetch("http://10.13.10.12:5001/api/lovSalesSeasons")
    .then((res) => res.json())
    .then((data) => {
      console.log("📥 Received from API:", data);
      setlovSalesSeasons(data);
    })
    .catch((err) => {
      console.error("❌ Fetch error:", err);
      setError("Error fetching data");
    });
}, []);

  return (
    <div>
      <h1>Dashboard</h1>

      {/* lovSalesSeasons */}
      <div className="kpis">
        {/* {lovSalesSeasons.map((kpi) => (
          <div className="kpi" key={kpi._id}>
            <h1>{kpi.value}</h1>
            <p>{kpi.name}</p>
          </div>
        ))} */}
        <div className="kpi">
          <h1>2,000</h1>
          <p>Exported (FCL)</p>
        </div>
        <div className="kpi">
          <h1>60,000,000</h1>
          <p>Production Cost (USD)</p>
        </div>
        <div className="kpi">
          <h1>80,000,000</h1>
          <p>FOB Sales (USD)</p>
        </div>
        <div className="kpi">
          <h1>10,000</h1>
          <p>Avg Margin per FCL</p>
        </div>
      </div>

      {/* Summary table */}
      <div className="lovSalesSeasons-list">
        <h3>Seasons</h3>

        {error && <div className="error-message">{error}</div>}
        <div className="table-container">
          <table>
            <thead>
              <tr>
                {/* <th>
                  <div className="table-header">
                    Season
                    <input
                      type="text"
                      placeholder="Search by Season"
                      value={lovSalesSeasonSearchTerm}
                      onChange={(e) => setlovSalesSeasonSearchTerm(e.target.value)}
                      className="Search-input"
                    />
                  </div>
                </th> */}
                <th>Season</th>
                <th>Crop</th>
                <th>Exported (FCL)</th>
                <th>Exported (MT)</th>
                <th>Prod.Cost (USD)</th>
                <th>FOB.Sales (USD)</th>
                <th>Margin (USD)</th>
                {/* <th>
                  <div className="table-header">
                    Status
                    <input
                      type="text"
                      placeholder="Search by Status"
                      value={statusSearchTerm}
                      onChange={(e) => setStatusSearchTerm(e.target.value)}
                      className="Search-input"
                    />
                  </div>
                </th> */}
              </tr>
            </thead>
            <tbody>
              {lovSalesSeasons
                // .filter(
                //   (season) =>
                //     season.name
                //       .toLowerCase()
                //       .includes(lovSalesSeasonSearchTerm.toLowerCase()) 
                    // &&
                    // kpi.value
                    //   .toLowerCase()
                    //   .includes(statusSearchTerm.toLowerCase())
                // )
                .map((season) => (
                  <tr key={season.season_prod}>
                    <td>{season.season_prod}</td>
                    <td>{season.crop}</td>
                    <td>{numberFormatter.format(season.dsph_fcl)}</td>
                    <td>{numberFormatter.format(season.dsph_eqbx)}</td>
                    <td>{numberFormatter.format(season.sls_frt_usd)}</td>
                    <td>{numberFormatter.format(season.sls_fob_usd)}</td>
                    <td>{numberFormatter.format(season.tot_sls_usd)}</td>
                  </tr>
                ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
